import React, { Component } from 'react'
import store from "../Reducers/index";
import checkmate from "../Actions/Action";
import keyPress from "../Actions/Action";
import removeItem from "../Actions/Action";



// import initState from "../Reducers/index";

function List() {

    //    store.subscribe( () => {
    //        console.log(store.getState());
    //    }   ) )
    // const state = store.getState();

    store.getState().todoitems.map((item,key)=>        
    <li key = {key} className="list-group-item"   > 
        <input type="checkbox" className="float-left my-3" onClick={checkmate.bind(this,key)} />  
        <input type="text" value={item.caption} className="myinput" onChange={keyPress.bind(this,key)} />              
        <button className="mybtn float-right" onClick ={removeItem.bind(this,key)} > X </button>               
    </li>  
    )
}


export default List;
